      <script>

        //window.onload = load;

        // Escucha mensajes del padre
        window.addEventListener('message', function(event) {
            // Verifica la fuente del mensaje para mayor seguridad
            if (event.source === parent) {
                // Ejecuta la funcin con el parmetro del mensaje
                load(event.data);
            }
        });

        //FUNC LOAD ---------------------------------------------------------------------------------------------------------------

        function load(currentTime) {

          document.getElementById("c_1").setAttribute('fill', 'none');
          document.getElementById("c_2").setAttribute('fill', 'none');
          document.getElementById("c_3").setAttribute('fill', 'none');
          document.getElementById("c_4").setAttribute('fill', 'none');
          document.getElementById("c_5").setAttribute('fill', 'none');
          document.getElementById("c_6").setAttribute('fill', 'none');
          document.getElementById("c_7").setAttribute('fill', 'none');

          fetch('../files/ISISclasses.json')
          .then(response => response.json())
          .then(data => {

            var totalEstudiantes = 0;
            var pisos = [];
            var numEstudiantesPiso = { c_1: 0, c_2: 0, c_3: 0, c_4: 0, c_5: 0, c_6: 0, c_7: 0};

            const classes = data;
            const currentYear = currentTime.getFullYear();
            const currentMonth = currentTime.getMonth() + 1;
            const currentDay = currentTime.getDate();
            const currentDayName = currentTime.toLocaleString('en-US', { weekday: 'long' }).toLowerCase();

            classes.forEach(course => {
              course.sections.forEach(section => {
                section.sessions.forEach(session => {
                  const startTime = new Date(`${currentYear}-${currentMonth}-${currentDay} ${session.startTime}`);
                  const finishTime = new Date(`${currentYear}-${currentMonth}-${currentDay} ${session.finishTime}`);
                  const dayName = session.day.toLowerCase()

                  const edificio = session.classroom.split('_')[0];

                  if ((currentTime >= startTime && currentTime <= finishTime) && dayName === currentDayName && edificio === "c") {
                    totalEstudiantes += section.enrolled;
                    console.log(section.enrolled);

                    if(session.classroom.startsWith('c_2')){
                      numEstudiantesPiso["c_2"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_3')){
                      numEstudiantesPiso["c_3"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_4')){
                      numEstudiantesPiso["c_4"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_5')){
                      numEstudiantesPiso["c_5"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_6')){
                      numEstudiantesPiso["c_6"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_7')){
                      numEstudiantesPiso["c_7"] += section.enrolled;
                    }
                    else if(session.classroom.startsWith('c_1')){
                      numEstudiantesPiso["c_1"] += section.enrolled;
                    }
                  }
                });
              });
            });
            console.log("total de estudiantes: " + totalEstudiantes);
            console.log(numEstudiantesPiso);

            compartirDatos(numEstudiantesPiso, totalEstudiantes);

            for (const edificio in numEstudiantesPiso) {
              if(numEstudiantesPiso[edificio] > 0){
                changeColor(edificio, numEstudiantesPiso[edificio], totalEstudiantes);
              }    
            }

          })
          .catch(error => console.error('Error al leer el archivo:', error));

          }

        //FUNC ChangeColor ---------------------------------------------------------------------------------------------------------------

          function changeColor(edfifcio, nClases, totalClases){

          var porcentaje = nClases/totalClases
          var color = getColorByPercentage(porcentaje);

          if(document.getElementById(edfifcio)){
            document.getElementById(edfifcio).setAttribute('fill', color);
          }  

          console.log(edfifcio + ": " + nClases + " " + porcentaje + " de " + totalClases + " color: " + color);

          }

        //FUNC getColor ---------------------------------------------------------------------------------------------------------------
          

          function getColorByPercentage(percentage) {
          var hue = (1 - percentage) * 60; // Ajusta el valor mximo del ngulo de matiz segn tus preferencias
          var saturation = 100; // Puedes ajustar la saturacin segn tus preferencias
          var lightness = 50; // Puedes ajustar la luminosidad segn tus preferencias

          var h = hue;
          var s = saturation / 100;
          var l = lightness / 100;

          var c = (1 - Math.abs(2 * l - 1)) * s;
          var x = c * (1 - Math.abs((h / 60) % 2 - 1));
          var m = l - c / 2;
          var red = 0;
          var green = 0;
          var blue = 0;

          if (0 <= h && h < 60) {
            red = c;
            green = x;
          } else if (60 <= h && h < 120) {
            red = x;
            green = c;
          } else if (120 <= h && h < 180) {
            green = c;
            blue = x;
          } else if (180 <= h && h < 240) {
            green = x;
            blue = c;
          } else if (240 <= h && h < 300) {
            red = x;
            blue = c;
          } else if (300 <= h && h < 360) {
            red = c;
            blue = x;
          }

          var r = Math.round((red + m) * 255).toString(16).padStart(2, '0');
          var g = Math.round((green + m) * 255).toString(16).padStart(2, '0');
          var b = Math.round((blue + m) * 255).toString(16).padStart(2, '0');

          return "#" + r + g + b ;
          }

        //FUNC cambiarPiso ---------------------------------------------------------------------------------------------------------------



        function cambiarPiso(str){
            window.parent.postMessage({ action: "ModificarPiso", value: str }, "*");
        }

        function compartirDatos(est, total){
            window.parent.postMessage({ action: "CargarDatos", value: est, total: total }, "*");
        }
    </script>
